import { GET_PLACES } from "../actions/types"

const initialState = {
    places:null,
    loading:false,
    currentPlace:null
}


export default (state = initialState, action) => {
    switch(action.type){

        case GET_PLACES:
            return{
                ...state,
                places: action.payload
            }

        default:
            return state
    }
}
